import React from "react";

function SearchForm() {
  return (
    <section className="searchform page__container">
      <form className="searchform__form" >
        <input type="search" name="key" placeholder="Фильм" className="search__input" autoComplete="off" required />
        <input type="submit" value=" " className="searchform__submit btn-opacity-change" />
        <div className="checkbox__container">
          <label className="checkbox__label">
            <input type="checkbox" className="checkbox" />
            <div className="checkbox__knobs"></div>
            <div className="checkbox__layer"></div>
          </label>
          <span className="checkbox__option">Короткометражки</span>
        </div>
      </form>
    </section >
  )
}

export default SearchForm;
